        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](27, " Alleppey, is the Alappuzha District administrative headquarters in the Indian State of Kerala. Alappuzha is a town and municipality in Kerala with a population of 174,164 people and ranks third among the districts in literacy rate in the State of Kerala. It is a major tourist destination in India. Alappuzha's Backwaters is one of Kerala's most popular tourist attractions. A houseboat cruise can be booked in these backwaters. It connects Kumarakom and Cochin to the north and Quilon to the south. The Kerala State Water Transport Department offers government boat services in the district, in addition to the houseboat services. It is also the point of entry for the annual Nehru Trophy Boat Race, held every year on the Punnamada Lake near Alappuzha on the second Saturday of August. That's the most competitive and famous of Indian boat races. The mullackal chirap is also one of Alapuzha's attractions which is the December festive season held every year for ten days. Alappuzha is home to both the Punnapra-Vayalar rebellion against the British, and the Feudal Raj revolt. The Diwan's unit, 200 men at Punnapra on 24 October 1946 and more than 150 at Vayalar on 27 October 1946 killed members of the Communist Party. The total loss of life is estimated to be in excess of a thousand. ");
