        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](31, " The Viceroy of the Indian Empire in the early first decade of the 20th century, Lord Curzon visited Alleppey, now Alappuzha, in the Capital. They called the early Cheras, who had their home in Kuttanad, 'Kuttuvans,' so named after this location. In their classical works Pliny and Ptolemy from the 1st and 2nd centuries had described places such as Purakkad or Barace. History tells that in the Middle Ages Alappuzha had trade ties with Greece and Rome. Literary works like \"Unnuneeli Sandesam\" give some insight into the ancient period of this district. Archaeological antiquities, such as the stone inscriptions, historical monuments found in the temples, churches, and rock-cut caves, also emphasise the historic importance of Alappuzha District. Christianity had a foothold in this district, even from the 1st century AD. The Kokkamangalam church was one of the seven churches founded by St. Thomas, one of Jesus Christ's twelve disciples. It is generally believed that in 52 AD he landed in Muziris Port at Maliankara, currently known as Cranganore or Kodungallur, and preached Christianity in South India. ");
