        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](48, " Fort Kochi is a quaint seaside region known for its colonial Dutch, Portuguese, and British architecture, and intricate bamboo fishing nets at Fort Kochi Beach. The original burial place of the explorer Vasco da Gama was St. Francis Church. Keralan specialties are served by upscale eateries and chic cafes, and quaint shops sell cotton clothes and handmade souvenirs. Heritage buildings home to galleries of modern art. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](49, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](50, " Fort Kochi was a fishing village in pre-colonial Kerala, in the Kingdom of Kochi. The territory that would later be known as Fort Kochi was given by the Kochi Rajah to the Portuguese in 1503, after he was supported by Afonso de Albuquerque's forces to combat the Kozhikode Saamoothiri's forces. The Rajah also gave them permission to construct Fort Emmanuel near the waterfront to safeguard their business interests. The first part of the Fort Kochi name comes from this fort, which was later ruined by the Dutch. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](51, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](52, " The Portuguese founded their settlement behind the fort including a wooden church that was rebuilt as a permanent structure in 1516, now known as the St Francis Church. Fort Kochi remained in control of Portugal for 160 years. In 1683 the Dutch invaded the Portuguese territories and destroyed many Portuguese institutions including Catholic convents. The Dutch kept Fort Kochi in their hands for 112 years until 1795, when the British defeated the Dutch to take control. Fort Kochi's international influence ceased with Indian independence in 1947. ");
