        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](67, " The Temple has been referred to in the Sangam Period of literature between 500 BCE and 300 CE several times. Many traditional historians and scholars are of the opinion that one of the names that the Temple had, \"The Golden Temple\", literally was in cognizance of the fact that the Temple was already unimaginably wealthy by that point. Several remaining pieces of Sangam Tamil literature and poetry, and later works of Tamil poet-saints from the 9th century, such as Nammalwar, refer to the temple and the city as having pure gold walls. In some cases, both the temple and the entire city are often eulogized as gold, and the temple as heaven. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](68, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](69, " Parasurama is thought to have consecrated Sree Padmanabha's idole in Dwapara Yuga. Parasurama assigned seven Potti families to 'Kshethra karyam' (Temple Administration)-Koopakkara Potti, Vanchiyoor Athiyara Potti, Kollur Athiyara Potti, Muttavila Potti, Karuva Potti, Neythasseri Potti and Sreekaryathu Potti. Parasurama instructed King Adithya Vikrama of Vanchi (Venad) to do 'Paripalanam' (Protection) of the Temple. Parasurama gave Tharananallur Namboothiripad the Templar Tantram. In 'Kerala Mahathmyam' which forms part of 'Brahmanda Puranam' this legend is recounted in detail. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](70, "br");
