        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](84, " The palace derives its name from the 122 horses carved into the brackets of the wooden wall supporting the south roof. The palace's official name is Puthen Malika. The palace is part of a large complex of royal buildings in Padmanabhaswamy Temple neighbourhood. After the demise of Swathi Thirunal in 1846 the building was left unoccupied for more than a century. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](85, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](86, " Built in the 1840s, Kuthiramalika is an example of traditional Kerala architecture, with its typical sloping roofs, overhanging eaves, pillared verandahs and enclosed courtyards. Intricate carvings adorn the wooden ceilings, with each room having a distinctive pattern. The construction of the palace was completed by 5000 Vishwabrahmins in four years. The palace is made from teakwood, rosewood, marble, and granite. The roof of the palace is made of wood and 42 beams support the carved patterns. The roof is supported by pillars made of granite. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](87, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](88, " Floral motifs dot the ceiling of the verandah.The main 16 rooms of the palace are constructed in 16 different patterns.In all, the palace contains 80 rooms, of which 20 were opened for visitors in 1995. The floor inside the palace is made of egg whites, charcoal, and limestone, which make it cold and smooth even in hot weather conditions. The concert venue built in the palace premises uses traditional sound reflectors comprising fifty clay pots hung upside down from the ceiling. ");
