        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](103, " The first motorable bridge in South India is the Punalur Suspension Bridge. The river-crossing suspension bridge is the only suspended-deck type in southern India. This massive bridge, designed by Albert Henry across the Kallada River in 1877, was suspended by two spans and used for vehicular movement. It took more than six years to build up. It's said people hesitated to step across the bridge after completing the bridge. The engineer and his family went under the bridge in a country boat as six elephants marched over it to show the power of the bridge. The bridge is of historical significance now and is a huge draw for visitors. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](104, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](105, " The key idea behind constructing this bridge was that areas on the other side of the Kallada river were dense forests. They needed a bridge. This was also constructed to keep wild animals from entering the inhabited side, a bridge that was made to shake when any one gets on it, this shaking scared off the animals so they wouldn't cross the bridge. ");
