        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](120, " It is said that the Palakkad Fort existed from ancient times, but it is assumed that it was built in the present form in 1766 A.D., but little is known about its early history. The local ruler, Palakkad Achchan, was initially a Zamorin tributary but had become independent before the early 18th century. In 1757 he sent Hyder Ali a deputation seeking support against an invasion that was threatened by the Zamorin. Hyder Ali took advantage of the chance to obtain a strategically important position such as Palghat, and from that time until 1790 the fort was in the possession of the Mysore Sultans or the British. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](121, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](122, " The latter took it for the first time in 1768 when it was seized by Colonel Wood during his assault on the fortresses of Hyder Ali, but Haider took it back a few months later. Colonel Fullarton recaptured it in 1783, after a siege that lasted for eleven days but was abandoned the following year. Later, it fell into the Zamorin troops 'possession. It was finally captured under Colonel Stuart by the British in 1790. It has been restored and used as a base for operations that ended with the Srirangapatnam storming. The fort remained in garrison until mid-19th century. It was turned into a Taluk office in the early 1900's. ");
