        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](137, " It is believed that the Edakkal caves are Neolithic group camping shelters (south Indian Neolithic culture zone). The walls of the cave hold a series of Neolithic rock engravings and drawings (that have been incised over time). The majority of images on the cave walls may belong to the late Neolithic period (i.e., first millennium BC). With the exception of Edakkal, no definitive evidence has so far been discovered for the presence of a true Neolithic culture in Kerala. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](138, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](139, " Fred Fawcett, Police Superintendent, Malabar District, discovered the caves in 1896 and immediately recognized their anthropological and historical significance. He wrote an article (1901) about the Indian Antiquary caves (Volume 30), attracting scholars 'attention. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](140, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](141, " Edakkal's caverns are not actually caves, but instead a cleft, rift or rock shelter about 96 ft (29 m) by 22 ft (6.7 m), a 30-foot (9.1 m) fissure created by a fragment of rock breaking off the main body. On one side of the cleft is a rock that weighs several tons, covering the cleft to form the cave's \"roof.\" ");
