        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](156, " During the visit of Vasco da Gama to India in 1498 the local Kolathiri king granted the land to Portuguese to establish a settlement in Kerala today. On 23 October 1505 he gave the permission to construct a fort at the site to the Portuguese chief Francisco de Almeida. The building operation started the very next day, on 24 October 1505, when the foundation stone was laid by Goncalo Gil Barbosa-the Portuguese Cannanore factor (Kannur). On October 30, 1505, the building of the wooden fort was completed: its first captain was Lourenco Britto, who commanded a garrison of 150 Portuguese men, and controlled two ships at sea. ");
