        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](25, " Originating in the Indian subcontinent, the five-day festival is stated in early Sanskrit texts. Diwali is usually celebrated eighteen days after the Dussehra (Dasara, Dasain) festival, with Dhanteras, or the regional equivalent, marking the first day of the festival when celebrities prepare by cleaning their homes and making floor decorations, such as rangoli. The second day is Naraka Chaturdashi, or the regional equivalent which is Diwali proper for Hindus in southern India. Western, southern, eastern, and northern Indian cultures celebrate Diwali's main day on the third day, Lakshmi Puja's day, and the traditional month's darkest night. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](26, "br");
