        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](33, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](34, " The Diwali festival is possibly a combination of ancient Indian harvest festivals. It is mentioned in Sanskrit texts like the Padma Purana, the Skanda Purana which were both completed in the second half of the 1st millennium CE. In Skanda Kishore Purana the diyas (lamps) are described as symbolizing parts of the sun, identifying it as the celestial giver of light and energy to all life and which transitions seasonally in Kartik's Hindu calendar month. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](35, "br");
