        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](37, " King Harsha refers to Deepavali, the Sanskrit play Nagananda in the 7th century, as D\u012Bpapratipadotsava, where lamps were lit and gifts were received from newly engaged brides and grooms. In his ninth century Kavyamimamsa, Rajasekhara referred to Deepavali as Dipamalika, in which he describes the custom of whitewashed homes and oil lamps decorating houses, streets and night markets ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](38, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](39, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](40, " Numerous travelers from outside India have also identified Diwali. The Persian explorer and historian Al Biruni wrote in his 11th-century autobiography on India about Deepavali being celebrated by Hindus on New Moon Day in the month of Kartika. The Venetian merchant and explorer Niccol\u00F2 de 'Conti visited India in the early 15th century and wrote in his memoirs, \"An infinite number of oil lamps, which are held burning day and night, are placed on each of these festivals inside their temples and on the outside of the roofs,\" and that the families would assemble, \"clothe themselves in new clothes,\" sing, dance and festival. ");
