        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](42, " Portuguese traveler Domingo Paes of the 16th century wrote of his visit to the Hindu Vijayanagara Empire, where in October Dipavali was celebrated with lamps illuminating householders and temples. ");
