        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](17, "div", 14);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](18, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](19, " Kathakali is a significant genre of Indian classical dance. It's an art form of \"plot play,\" but one that's differentiated by the elaborately colored make-up, makeup and face masks that the actor-dancers typically wear. Kathakali is a Hindu performance art in south-west India's Malayalam-speaking region. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](20, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](21, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](22, " The origins of the Kathakal\u012B are uncertain. Kathakal\u012B's fully evolved style emerged around the 17th century, but its origins lie in the temple and folk arts (such as Kutiyattam and the religious drama of the southwestern Indian peninsula), which can be traced back to at least the 1st millennium CE.A Kathakali production, like all India's classical dance arts, synthesizes music, vocal dancers, choreography, and hand- and facial movements. Kathakali, however, varies in that it also combines moves from ancient Indian martial arts and South India sporting styles. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](23, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](24, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](25, " The Kathakal\u012B's common themes are folk mythologies, religious stories, and philosophical concepts from the Hindu epics and Puranas. Historically, the vocal performance was performed in Sanskritised Malayalam. Indian Kathakali troops have featured women performers in contemporary works, as well as adapted Western stories and plays such as Shakespeare's. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](26, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](27, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](28, "b");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](29, "History");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](30, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](31, " Kathakal\u012B's elements and features can be found in ancient Sanskrit texts such as the Natya Shastra. The kathakali is credited to sage Bharata, and its first full compilation is between 200 BCE and 200 CE, but estimates differ between 500 BCE and 500 CE. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](32, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](33, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](34, " The most studied version of the Natya Shastra text consists of around 6000 verses divided into 36 chapters. The text, says Natalia Lidova, explains the theory of T\u0101ava dance (Shiva), the theory of rasa, bh\u0101va, speech, movements, techniques of acting, basic steps, standing positions \u2013 all of which are part of classical Indian dances like Kathakali. Dance and performing arts, says thi. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](35, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](36, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](37, " Kathakal\u012B is organized around plays called Attakatha, written in Sanskritized Malayalam. Such plays are written in a particular style that helps to distinguish the \"action\" and \"dialogue\" sections of the performance. The Shloka portion is the metric verse, written in third person, mostly entirely in Sanskrit, explaining the choreography component of the action. Both such plays have traditionally been drawn from Hindu scriptures such as the Ramayana, the Mahabharata, and the Bhagavata Purana. ");
