        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](40, " A repertoire of Kathakal\u012B is an operatic production in which an ancient tale is playfully dramatized. A Kathakali performance is usually long, beginning at dusk and continuing through dawn, with interludes and breaks for the performers and audience. Some plays continued for many hours, beginning every day at dusk. Traditional spectacles are shorter. The stage with seating usually in open grounds outside a temple, but in some places special theaters constructed within the temple compounds, called Kuttampalam, were in use. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](41, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](42, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](43, " Kathakali has the most elaborate costuming of all classical Indian dances, consisting of head costumes, face masks and face painted with vividness. Usually, planning a Kathakali troupe takes many evening hours to get ready for a play. Costumes have made Kathakali's popularity spread beyond adults, with children fascinated by the performance's colors, makeup, light and sound. ");
