        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](45, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](46, " As with other classical Indian arts, Kathakali is as much choreography as acting. It's said to be one of the hardest styles to perform on stage, with young artists training for their parts for several years before they get an opportunity to do it on stage. The actors speak a \"sign language,\" where the word component of the dialog of the character is conveyed through \"hand gestures (mudras),\" while emotions and mood are conveyed through movements of \"facial and eye.\" ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](47, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](48, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](49, " There are 24 primary mudras in Kathakali, and several other minor ones. There are nine facial expressions, called Navarasas, which each actor learns throughout his education by facial muscle control to convey the character's emotional state in the story. Classical Sanskrit texts such as Natya Shastra include the philosophy behind the Navarasas but often with different names and these are also present in other classical Indian dances. The nine Navarasas express nine Bhava (emotions) in Kathakali as follows: Sringara expresses Rati (love, enjoyment, delight), Hasya expresses Hasa (comic, laugh, mocking), Karuna expresses Shoka (pathic, sad), Raudra expresses Krodha (anger, fury), Vira expresses Utsaha (vigour, enthusiasm, heroic), Bhayanaka expresses Bhaya (fear, concern, worry), Bibhatsa expresses Jugupsa (disgust, repulsive). ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
