        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](27, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](28, " It is in this temple that Kannaki Amman, the heroine of Silappathikaram, the Tamil story of Ilango Adigal, found salvation. She came to Kodungallur, prayed to Kodungallur's Bhadrakali, and was absorbed into the murti. The temple is said to have been founded by Cheraman Perumal. A Thiyyar from Malabar performed the first Shakteya Pooja in the Kodungallur temple. Also presently, in the presence of kodungallur raja, the Thiyya thandans (An administrative position) of 64 tharas meet at Nilapaduthara in Kodungaloor. In these Thiyya thandans is performed the kodungaloor meena bharani. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](29, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](30, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](31, " In Tantric terms, the divinity is installed in what is called the pattern of \"Rurujit Vidhaana,\" a type of installation with Shiva at one end, Ganesha at the other, with the goddesses of Sapta Matrika in between. In ancient times animal sacrifices were offered at the temple by devotees seeking safety and the fulfillment of their prayers, often in the forms of birds and goats. Cochin's government banned animal sacrifice in any form at this location, at the intervention of many \"social reformers.\" At present, the deity is only given red-tinted dhotis. Many devotees give gold ornaments and rich gifts. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](32, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](33, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](34, " The temple is located in the center of a ten-acre plot of land, surrounded by banyan and peepal trees. The srikovil faces towards north. The inner temple's western chamber is the seat of Sapthamatrukas (Seven Mthers), who also faces north. The chamber holds the idols of Ganapathi and Veerabhadra, one facing east and the other facing west, respectively. The bhagawati idol is about 7 feet tall and made of wood, carved from a tree of jackfruits. The idole has eight arms which carry symbols and weapons. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
