        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](22, " Like other classical Indian dances, Mohiniyattam's origins are in the Natya Shastra \u2013 the ancient Hindu Sanskrit text on performing arts. It follows however the Lasya style mentioned in Natya Shastra, which is a delicate, eros-filled and feminine dance. After intensive preparation it is typically a solo dance performed by women. Mohiniyattam's repertoire includes Carnatic-style music, singing and acting a play through dance, where the recitation may either be performed by a separate vocalist or the dancer herself. The song is traditionally called Manipravalam in Malayalam-Sanskrit hybrid. ");
