        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](25, " The earliest mention of the word is found in the 16th-century legal text Vyavaharamala, but the probable origins of the dance are older. The dance was systematized in the 18th century, and ridiculed during the colonial British Raj as a Devadasi prostitution system, outlawed by a series of laws from 1931 to 1938, a ban that was protested and partially repealed in 1940. Ultimately, the socio-political conflict brought renewed interest, revival and reconstruction of Mohiniyattam by the people of Kerala, particularly poet Vallathol Narayana Menon. ");
