        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](27, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](28, " The origin of Mohiniyattam's is uncertain, according to Reginald Massey. Kerala, the region where this dance genre evolved and is popular, has a long history of lasya-style dances, the basics and structure of which may be at the heart. In Kerala temple sculpture is found the earliest evidence of Mohiniyattam, or a dance style similar to Mohiniyattam. In Mohiniyattam pose, the Vishnu temple of the 11th century at Trikodithanam, and the Kidangur Subramanya temple have many sculptures of female dancers. The textual evidence from the 12th century onwards indicates that L\u0101sy\u0101 themes were included by the Malayalam poets and playwrights. Nambootiri's Vyavaharamala of the 16th century contains the first known mention of the word Mohiniyattam, in connection with a payment to be made to a Mohiniyattam dancer. Another book, Gosha Yatra, from the 17th century also mentions the term. The Balarama Bharatam of the 18th century, a major secondary work written in Kerala on Natya Shastra, mentions many dance styles like Mohini Natana. ");
