        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](25, " There's a lot of speculation on why this location is called Oachira. Some people believe the name of the place came from the word Omkarachira and others say the name comes from the name Oymanchira. There are also firm convictions that the name deriving from Uvachanchira as Uvachan means Lord Siva by belief. Many of those conclusions are myth-based. ");
