        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](20, " Onam is a Hindu holiday and festival held annually in Kerala, India. It is also a harvest festival, which falls on the 22nd nakshatra Thiruvonam in Chingam's Malayalam calendar month, which overlaps with August \u2013 September in Gregorian calendar. According to legends, the festival is celebrated to honor King Mahabali, whose spirit is said to visit Kerala at Onam's time.");
