        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](23, " The word Onam is derived from the Sanskrit word Shravanam which refers to one of the 27 constellations or Nakshatars. Throughout South India, Thiru is used for everything associated with Lord Vishnu, and it is believed that Thiruvonam is Lord Vishnu's Nakshatra who pushed the King Mahabali with his foot to the underworld. ");
