        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](26, " Onam falls in the Chingam month, which according to the Malayalam Calendar is the first month. The celebrations mark the New Year of Malayalam, are spread over ten days, and end with Thiruvonam. Sequentially, the ten days are numbered Atham, Chithira, Chodhi, Vishakam, Anizham, Thriketa, Moolam, Pooradam, Uthradam, and Thiruvonam. The first and the last day in Kerala and in other communities of Malayalee are especially significant. ");
