        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](32, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](33, " In Hindu mythology, Mahabali was the great-grandfather of a Brahmin sage named Kashyapa, the great-grandfather of the evil tyrant, Hiranyakashipu, and Vishnu devotee grandson Prahlada. This ties the festival to Holika fame Prahlada's Puranic mythology in Hinduism, who was Hiranyakashipu's wife. Despite being born to an evil Asura father who despised Vishnu, Prahlada rebelled against the oppression of people by his parents, and worshiped Vishnu. Hiranyakashipu attempts to kill his son Prahlada, but in his Narasimha form, Vishnu is slain and Prahlada is rescued. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](34, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](35, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](36, " The grandson of Prahlada, Mahabali, came to power by slaying gods and taking the three worlds over. The defeated Devas asked Vishnu for aid in their war with Mahabali according to the Vaishnavism mythology. Vishnu declined to join the gods in violence against Mahabali, for Mahabali was a decent ruler and devotee of his own. Instead he wanted to check the dedication of Mahabali at a appropriate time. After his triumph over the gods, Mahabali announced he would do a Yajna and grant any request during the Yajna to everyone. Vishnu took, and approached Mahabali, the avatar \u2013 his fourth \u2013 of a dwarf boy named Vamana. The king offered the boy something-gold, cows, elephants, villages, food, whatever he wanted. The boy said one shouldn't be searching for more than one wants and all he wanted was \"three pieces of land.\" Mahabali agreed. ");
