        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](20, " Padayani, also known as Padeni, is a traditional folk dance and ritual art from the central part of Kerala's Indian state. A ceremonial dance involving masks, it is an old practice performed in temples of Bhagavati. In memory of Bhadrakaali the dance is done. ");
