        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](22, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](23, " Padayani is an art form combining music, dance, theatre, satire, masks and paintings. It is part of Bhadrakali worship and is staged from mid-December to mid-May in temples dedicated to the goddess. Padayani is located in central Travancore, which includes Kerala's Pathanamthitta district. Padayani is considered a legacy of the Dravidian worship forms which existed before the advent of Brahmanism. The Patayani percussion instruments are patayani thappu, chenda, para, and kumbham. ");
