        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](30, " Padyani is a modern Kolam Thullal style, a ritual dance performed by Kerala's magic-medicine people. In the past, this elaborate and costly event was carried out to cure diseases of deep psychological dysfunctions without any apparent specific physical cause, and cases that seemed unfit for medical modalities of intervention. This type of psychological or spiritual healing, otherwise known as Kolam Thullal, was planned, regulated and performed exclusively by the Tinta sub-sect of the Thullal. ");
