        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](32, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](33, " Another version of its origin has to do with ancient martial arts training in Kerala. The Ganaka people have been known by society since the Samgham period as traditional preceptors of martial arts and letters. Since the root of term padayani relates to military parade or army ranks, it is widely believed that the Nair trainees (fighters) and their Preceptors-Kalari Asans (Kaniyar Panicker) emerged from a symbolic past reminiscent of the fencing march of martial art to fear the enemy troop and demonstrate their strength. ");
