        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](35, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](36, " The roles of different functions related to this dance were gradually divided and distributed to people from different communities. Thus the Nair folk became the performers of the modern form of Padayani art, but the local Kaniyar people had the right to write songs, the design and the making of elaborate costumes. Today the modern form of Padayani is performed in many Devi temples in the southern region of Kerala, particularly in the districts of Pathanamthitta, Kottayam, Alappuzha, and Kollam. ");
