        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](41, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](42, " A very destructive war between the devas (gods) and the asuras (anti-gods) left the asura class only to two women, Danavathi and Darumathi. Left to themselves, they performed tapasya (penance of devotion), to satisfy the founder of Brahma. Through begot a son, Danava and Darika by his blessings. When Darika reached age Darumathi told him the sad tale of the devas 'loss and devastation of their class. She exhorted him to do penance in order to please Brahma and gain powers with which to regain their class's lost glory. Darika performed arduous apasy that could not be ignored by Brahma, and he blessed him with forces that could protect him from harm by man or god day and night. Brahma bestowed on him the mighty Brahma rod, a tool of great destructive power. Yet an arrogant turn by the asura angered Brahma who attached a divine damsel to the luck of his devotee's death. Darika constructed a magnificent palace on the shores of the western sea with the aid of the supernal architect Maya, and declared safety and honor for all the remaining members of his class scattered and hiding. He reconstituted the asura army with their help, fought the chief of gods with Indra, and defeated him. With this Darika has not ended. He made occasional military excursions into the devas 'territories, and became a constant threat to them. Thus Brahma created Brahmi, Vishnu created Vaishnavi and Shiva Maheswari, Indra Indrani, Subrahmanya Kumari, and Yama Varahi. The gods in distress appealed to Vishnu the great god of survival who directed them to Shiva who told them that only a goddess of extraordinary prowess could slay Darika. And their joint effort could not beat Darika. Then fate came in Darika's way, in the form of Narada, the celestial monk. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](43, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](44, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](45, " The haughty asura reproached the priest, threatening to kill him. The distraught Narada went to Kailasa, and complained of the demonic conduct to Shiva. The angered Shiva created Bhadrakali from his third eye and entrusted the task of destroying the asura to her. Darika's minister killed in the battle which followed Bhadrakali. Provoked, Darika wanted to challenge Kali, but he transferred all the important mantras (invocation hymns) to his aunt, before going to the battlefield. Darika used the brahma rod which forced Kali to withdraw. Goddess Kartyayani, Kali's friend, who knew Darika was no longer the sole owner of his powerful mantras, deceived the asura's wife into disguising herself as an innocent Brahmin child. Despite all the opponent's strong mantras now with her, Kali fought with Darika and caught Brahma's rod on the twenty-second day, cut off her opponent's head and kill her thirst with his blood. And after the war ended Kali's wrath raged. Her army of goddesses and phantoms, frightened at their leader's unusual wrath, fled the area, seeking refuge in Shiva. ");
