        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](25, " \"There can be little question,\" Bridget and Raymond Alchin tell, \"that a very large part of this modern folk religion is extremely ancient and includes characteristics that originated in the earliest periods of Neolithic, Chalcolithic settlement and language,\" there is no question, mostly, provided from fremin. There are approximately 400 types of Theyyam, including Vettakkorumakan, Vishnumoorthy Theyyam, Muchilot Bhagavathi theyyam And Sree Muthappan Theyyam. ");
