        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](27, " All the prominent features of primitive, tribal, religious worship had broadened the stream of Theyyam cults, where \"only the adherents of Islam are identified with religion in its practical dimension\" and made it a deep-rooted folk religion of millions. For example, Bhagawathi's cult, the Mother Goddesses, had an important place in Theyyam, and still has one. In addition to this, rituals such as spirit-worship, ancestor-worship, hero-worship, masathi-worship, tree-worship, animal worship, serpent-worship, the worship of the disease goddesses and the worship of Gramadevata (Village-Deity) are included in the mainstream of Theyyam culture. Along with these Gods and Goddesses there exist innumerable folk Gods and Goddesses. Most of these Goddesses are known as Bhagavathy (the Mother-Goddess that is the Divine and United form of the three principal Goddesses namely, Brahmani (Saraswati), Vaishnavi (Lakshmi), and Shivani (Parvati). ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](28, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](29, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](30, " The dance or invocation is normally performed in front of the shrine at the village. It is often conducted as ancestor-worship with elaborate ceremonies and rituals in the homes. There is no stage or curtain for the show, or any such arrangements. The devotees would stand or some would sit on a holy tree in front of the shrine. This is, in short, an open theatre. According to its importance and hierarchy a output of a specific deity in the shrine continues with intervals for 12 to 24 hours. In the rituals will reside the chief dancer who propitiates the shrine's main deity. Further, this particular dancer wouldn't eat anything for the rest of that day after the sunsets. Specialists and other dancers make up his make up. The performance's first part is usually known as Vellattam, or Thottam. It is done without any elaborate costume or proper makeup. This time only a thin, red headdress is worn. ");
