        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](32, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](33, " Together with the drummers, the dancer recites the specific ritual song explaining the myths and legends about the shrine deity or the folk deity to be propitiated. Accompanying this is playing folk musical instruments. The dancer returns to the greenroom after performing this main ritualistic aspect of the invocation. Again he appears with full makeup and costumes after a short break. Face-painting habits are distinctive. Vairadelam, kattaram, kozhipuspam, kottumpurikam, and prakkezhuthu are some of these patterns. For face painting primarily primary and secondary colors are used with contrast. In the dances, it helps to affect some stylisation. Then the dancer comes into the shrine's specific deity in front of the altar, and slowly \"metamorphoses.\" He, after performing several rituals, puts the head-dress on his head, and starts to dance. Folk musical instruments such as chenda, tudi, kuzhal, and veekni are played at a certain pace in the background. All of the dancers take in their hands a shield and kadthala (sword) as a continuation of the arms cults. The dancer then circumnavigates the temple, runs through the courtyard and starts to dance there. The dance of The Theyyam has different steps known as Kalaasams. Each Kalasam is systematically repeated from the first through the eighth step of footwork. A performance is a mixture of musical instruments, vocal recitations, dance, and special (usually mainly orange) make-up and costumes. One of the popular sieyams in Kerala is the Kathivanoor Veeran Theyyam. ");
