        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](32, " Lord Shiva's celestial dance reflects five actions-creating, defending, killing, embodying, and releasing. Essentially it reflects the continuing process of development and destruction. This cosmic dance occurs within each particle and is the source of all energy. Arudra Darshan enjoys this Lord Shiva joyful dance. ");
