        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](20, " Thrissur Pooram is a Hindu festival that is held annually in Kerala. It's held annually on Pooram Day at the Vadakkunnathan Temple in Thrissur-the day the moon rises with the Pooram star in Medam's Malayalam Calendar month. Among all the poorams, it is the largest and most popular. ");
