        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](23, "b");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](24, "History of Thrissur Pooram");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](25, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](26, " Thrissur Pooram was the brainchild of Raja Rama Varma, known as Sakthan Thampuran, Cochin's Maharaja (1790\u20131805). The largest temple festival in Kerala was the one- festival held in Aarattupuzha, known as Arattupuzha Pooram, before the start of Thrissur Pooram. Temples were frequent participants in and around the town of Thrissur. In the year 1798 the temples with from Thrissur were late for the Arattupuzha Pooram because of incessant rains and were denied entry to the Pooram procession. Feeling ashamed and frustrated at the refusal, the authorities at the temple discussed the matter with Sakthan Thampuran. ");
