        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](19, " In Kerala, the Christmas celebration way shows the presence of Christians from both Syria and the West. It is understood that the state adds the flavor of local traditions that includes preparing some exotic delicacies to make the celebrations even more exciting. As in many Christian countries, Christmas preparations start from the beginning of the month of December. People prepare dry fruit cakes that are exchanged for Christmas season throughout the season. Midnight mass attendance is also a part of tradition. ");
