        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](26, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](27, " The text describes the adventures of Thomas in bringing Christianity to India, a practice which was later expanded in early Indian sources such as the \"Thomma Parvam\" (\"Thomas Song\"). Generally he is identified as coming to or around Maliankara and founding Seven Churches and Half Churches, or Ezharapallikal: Kodungallur, Kollam, Niranam, Nilackal (Chayal), Kokkamangalam, Kottakkavu, Palayoor and Thiruvithamcode Arappalli (Half Church). A number of Roman writers from the 3rd and 4th centuries also mention the trip of Thomas to India, including Ambrose of Milan, Gregory of Nazianzus, Jerome, and Ephrem the Syrian, while Eusebius of Caesarea reports that his teacher Pantaenus visited a Christian group in India during the 2nd century. A Christian group which were primarily merchants came into being. ");
