        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](8, " Kerala's ancient past is enshrouded in common mists. The most famous legend will have it lifted from the depths of the ocean to the land crust that shapes the State. Lord Vishnu's Brahmin avatar Parasurama had waged an epic sequence of vindictive wars on the Kshatriyas. Came a moment when regret overwhelmed Parasurama at the wanton devastation he had wrought. He gave extreme penance up the heights of the mountain. The sage heaved his mighty axes into the middle of the distant ocean in a mood of profound atonement. The waves shoamed and frothed as a prawn-shaped land extending from Gokarnam to Kanyakumari emerged to form the State from the depths of the sea and thus the sobriquet 'Gods Own country. ");
