        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](28, " Kannur is a coastal city in the south Indian state of Kerala. It was once an ancient trading port. Enduring monuments such as 16th-century St. Angelo Fort, once occupied by European colonial forces, show the city\u2019s significant role in the spice trade. Housed in a former palace, the Arakkal Museum highlights Kerala's one Muslim royal family. The palm-fringed sands of Payyambalam Beach run along Kannur\u2019s western shore. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](29, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](30, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](31, "b");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](32, "History: ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](33, " In the 12th century, Kannur was an important trade centre, with strong business ties with Persia and Arabia. It served as the British Army headquarters on the west coast of India until 1887. The modern city is called Town of Kannur. The mostly prominent Kolathiri Rajas (Kings) were ruled as a district and surrounding areas. The district took the name Kannur when the state of Kerala was created, since the administrative offices were built here. Prior to that, Kannur had been under British rule under the Chirakkal taluk of Madras state. When the British ruled this part of the country, they chose Madras and Cochin to be their main stations and Kannur started to lose its old glory. The Kannur people are still waiting for their old glory to come back and they feel sidelined because the state administration is located on the exact opposite side of the district. Part of Kannur's original city was under the sole Muslim Royalty of Kerala called the Arakkal and this region is still regarded as a district. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](34, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](35, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](36, " The St. Angelo Fort was founded by the first Portuguese Viceroy of India, Dom Francisco de Almeida, in 1505. In 1663 the Dutch seized the Portuguese Castle. They modernized the fort and designed Hollandia, Zeelandia, and Frieslandia bastions which are the key characteristics of the present structure. The main Fort in Portugal was later taken down. The Rijksmuseum Amsterdam contains a drawing of this fort and the fishing boat behind it. In 1772 the Dutch sold the fort to Arakkal king Ali Raja. Kannur was the capital city of the one Muslim Sultanate in Kerala, known as Arakkal, during the 17th century. It was then captured by the British in 1790 and used as one of their main military stations along the Malabar Coast. Kannur was part of Madras province in the District of North Malabar during the British Raj. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](37, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](38, "br");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](39, " Pazhassi Raja's guerrilla war against the British, ruler of Kottayam province, had a huge impact on Kannur's history. Changes in Kerala's socio-economic and political sectors during the initial decades of the 20th century produced congenial conditions for the Communist Party's development. Extension of English education initiated by Christian missionaries in 1906 and later carried forward by government, rebellion for wearing a cloth to cover upper parts of body, installing an idol at Aruvippuram in 1888, Malayali Memorial in 1891, establishment of SNDP Yogam in 1903, activities, struggles etc. became factors helpful to accelerate changes in Kerala society during a short time. Movements to free themselves from British imperialism's colonial rule and the struggles initiated by those movements grew with them. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](40, "br");
