        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](28, " Wayanad is a district with administrative headquarters in the municipality of Kalpetta in the north-east of Kerala state. It is located high on the Western Ghats with altitudes of between 700 and 2100 metres. The district was established as the 12th district in Kerala on 1 November 1980, by carving out areas from the districts of Kozhikode and Kannur. Approximately 885.92 sq.km of district land is under forest. The district of Wayanad is bordered by Karnataka on the north and north-east, Tamil Nadu on the southeast, Malappuram on the south, Kozhikode on the south-west and Kannur on the north-west. Pulpally in Wayanad boasts of Kerala's only Lava-Kusha temple, and Vythiri has Kerala's only mirror temple which is a Jain temple. Ambukuthi Mala's edicts and caves and other evidence indicate that the place is as old as the beginning of the New Age Civilisation. ");
