        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](33, " Historians believe that in those parts the human settlements existed at least ten centuries before Christ. Most evidence of the culture of the New Stone Age can be seen in the present Wayanad district in the hills. The Edakkal Caves have Neolithic period rock engravings, which are 6000 years old. This district's known history is only available as from the 18th century. In ancient times the Rajas of the Veda tribe ruled this region. In the 11th century A.D., North Canara Kadamba dynasty dethroned Gangas from Bayalnad. Around that time Wayanad was divided into two parts-Bira Bayalnad and Chagi Bayalnad. One of the Mysore inscriptions says 'this storeyed palace, the double Bayalnad, was an adulteress with black wave waves, as an adulteress with a full-moon crown, an adulteress with endless side-glances, an adulteress with an adorned slim figure.\u00A0Kadamba Bayalnad emerged as a rule in the 11th century under their ruler Raviyammarasa with Kirttipura in their capital Punnad. Kanthirava (1090 CE) has been identified as Chagi-Bayalnad Ruling. Iravi-Challamma (1108 CE), Bira-Bayalnad ruler. ");
